import React from 'react'
import GithubUser from './GithubUser'

export default function GithubListUser(props) {
    return ( 
        <ul>
            {props.items.map((item) => <GithubUser key={item.id} login={item.login} user={item.user} />)} 
            
        </ul>
    )
}
